import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import { AuthProvider } from "./pages/AuthContext";
import { CartProvider } from "./pages/CartContext"; // New import
import Login from "./pages/Login";
import Register from "./pages/Register";
import Home from "./pages/Home";
import Dashboard from "./Dashboard";
import ProductDetail from "./components/product/ProductDetail";
import Wishlist from "./Wishlist";
import "./index.css";
import Profile from "./pages/Profile";
import AdminProductForm from "./components/admin/AdminProductForm";
import CartPage from "./pages/CartPage"; // New import
// import OrderConfirmation from "./pages/OrderConfirmation"; // New import

function App() {
  return (
    <Router>
      <AuthProvider>
        <CartProvider>
          <Navbar /> {/* Added Navbar */}
          <Routes>
            <Route path="/" element={<Navigate to="/login" />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/home" element={<Home />} />
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/profile" element={<Profile />} />
            <Route path="/product/:id" element={<ProductDetail />} />
            <Route path="/wishlist" element={<Wishlist />} />
            <Route path="/admin/product-form" element={<AdminProductForm />} />
            <Route
              path="/admin/product-form/:id"
              element={<AdminProductForm />}
            />

            {/* New Cart Routes */}
            <Route path="/cart" element={<CartPage />} />
            <Route path="/checkout" element={<Checkout />} />
            {/* <Route path="/order-confirmation" element={<OrderConfirmation />} /> */}

            {/* Optional: 404 Page */}
            <Route path="*" element={<Navigate to="/home" />} />
          </Routes>
        </CartProvider>
      </AuthProvider>
    </Router>
  );
}

export default App;
